Royal Paintbox: Artists of the Royal Family

Arts Documentary hosted by Margy Kinmonth, published by PBS in 2014 - English narration


Information
------------------------------

In a story previously untold on film, HRH The Prince of Wales makes a journey through history to celebrate the artistic gene in his family and reveal an extraordinary treasure trove of work by royal hands past and present.
Set against the spectacular landscapes of the Royal Estates and containing insights into works by members of the Royal Family down the centuries and The Prince of Wales's own watercolours, ROYAL PAINTBOX explores a colourful palette of intimate family memory and observation.

